	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  359583,"113",25000,NULL,1976,
	  "0.30 AUD",52.000,NULL,"KG Murray often reprinted DC comics out of order. This issue Lois Lane Comic #113 is an example. It reprints Superman's Girlfriend Lois Lane #136. KG Murray's Lois Lane Comic #112 the previous issue reprinted Superman's Girlfriend Lois Lane #137.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  359584,"114",25000,NULL,1976,
	  "30 cents",52.000,NULL,"Lois Lane Comic #114 is the last 48 pages/30 cent issue. The size and price increases with #115 (64 pages/40 cents).",
