	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  359585,"115",25000,NULL,1976,
	  "0.40 AUD",68.000,NULL,"First 40 cents/64 page issue of KG Murray's Lois Lane Comic. Four other KG Murray titles made the move from 30 cents/48 pages to 40 cents/64 pages in July 1976: Flash (with #132); Mighty Comic (#114); Superboy (#100); Supergirl (#21)",
	  NULL,NULL,NULL,NULL,NULL,NULL
