	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  359589,"119",25000,NULL,1976,
	  "0.40 AUD",68.000,NULL,"Lois Lane Comic #119 was the last issue of Lois Lane Comic published in 1976. In the indicia there is a copyright notice \"...copyright National Periodical Comics.\" The next issue of Lois Lane Comic #120 has a copyright notice \"...copyright DC Comics.\" In the original American editions the name change from National Periodical Comics to DC Comics occurred in December 1976 (for March 1977 cover-dated comics). My theory is that there would have been some delay for foreign editions like KG Murray before the name change took effect. So in all likelihood the first KG Murray edition to have a 'copyright DC Comics' notice in it is the first edition of that title for 1977.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
