	  359592,"122",25000,NULL,1977,
	  "50 cents",68.000,NULL,"Lois Lane Comic increases in price from AUS/NZ 40 cents to AUS/NZ 50 cents with this issue circa September 1977. KG Murray increased the price of all its black and white titles at this time. So 64 page titles increased from 40 cents to 50 cents (Flash #139;Lois Lane Comic #122;Mighty Comic #120;Superboy #107;Supergirl #27) and 96 page titles from 50 cents to 75 cents (Batman Album #38;Bumper Batcomic Album #8;Green Lantern Album #7;Super Adventure Album #6;Super Heroes Album #8;Superman Album #31;Wonder Woman Album #5). KG Murray's two colour reprint titles Batman and Robin and Superman had already increased in price from 30 cents to 35 cents at the start of 1977.",
	  NULL,NULL,NULL,NULL,NULL,NULL
